import React from 'react';
import {Button} from 'react-bootstrap';

class Course extends React.Component{
    constructor(){
        super()
    }

    render(){
        return(
            <div>
                <h1>Course</h1>
                <Button variant="Success">Dark</Button>{' '}
            </div>
        )
    }
}
export default Course;
